import { Document, Page } from 'react-pdf';

class PDFViewerComponent extends Component {
    state = {
        numPages: 1,
        pageNumber: 1,
    }

    onDocumentLoadSuccess = ({ numPages }) => {
        this.setState({ numPages });
    }

    render() {
        const { pageNumber, numPages } = this.state;

        return (

            <iframe src="https://psharingaccount.blob.core.windows.net/psp-resume-project-test/Exercise14cd88786-4cab-41a3-8e13-8038b9e52128.pdf" title="W3Schools Free Online Web Tutorials"></iframe>

        );
    }
}

export default PDFViewerComponent;
